import React from 'react';
import storecomponents from '../services/StoreServices';
import {Navbar,Table,Brand, Toggle, Collapse} from 'react-bootstrap';
class StoreComponents extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            tables: []
        }
    }
    componentDidMount() {
        storecomponents.getStores().then((Response) => {
            this.setState({ tables: Response.data })
        });
    }

    render() {
        return (
            <div>
                <Navbar>
                    <Navbar.Brand href="#home">Welcome to Store</Navbar.Brand>
                    <Navbar.Toggle />
                    <Navbar.Collapse className="justify-content-end">
                        <Navbar.Text>
                            Signed in as: <a href="#login">Ansh Panchal</a>
                        </Navbar.Text>
                    </Navbar.Collapse>
                </Navbar>
                <hr></hr>
                <h1 className="text-center" color="text-primary">Available Stores to Reach</h1>
                <hr></hr>
                <Table striped bordered hover variant="dark">
                    <thead>
                        <tr>
                            <th>Store Id</th>
                            <th>Store Name</th>
                            <th>Store Email-Id</th>
                            <th>Store Mobile Number</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.tables.map(
                                table =>
                                <tr key = {table.id}>
                                    <td>{table.id}</td>
                                    <td>{table.storename}</td>
                                    <td>{table.emailId}</td>
                                    <td>{table.mobileNumber}</td>
                                </tr>
                            )
                        }
                    </tbody>
                </Table>
            </div>
        )
    }
}
export default StoreComponents
